t: scroll; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0px 0px; background-repeat: repeat;"> </p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px; border: 0px none; font-size: 14px; outline: none 0px; padding: 0px; color: rgb(85, 85, 85); font-family: ''Times New Roman'', Times, serif; line-height: 20px; background-image: none; background-attachment: scroll; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0px 0px; background-repeat: repeat;">Tính cách Bọ Cạp mãnh liệt, nhạy cảm và hoàn toàn không thể đoán được sở thích. Bọ Cạp thích ăn uống và nấu nướng nên những chiếc bánh của Bọ Cạp kì lạ trong mắt mọi người.</p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px; border: 0px none; font-size: 14px; outline: none 0px; padding: 0px; color: rgb(85, 85, 85); font-family: ''Times New Roman'', Times, serif; line-height: 20px; background-image: none; background-attachment: scroll; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0px 0px; background-repeat: repeat;">9. Cung Nhân Mã</p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px; border: 0px none; font-size: 14px; outline: none 0px; padding: 0px; color: rgb(85, 85, 85); font-family: ''Times New Roman'', Times, serif; line-height: 20px; background-image: none; background-attachment: scroll; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0px 0px; background-repeat: repeat;"> </p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px; border: 0px none; font-size: 14px; outline: none 0px; padding: 0px; color: rgb(85, 85, 85); font-family: ''Times New Roman'', Times, serif; line-height: 20px; background-image: none; background-attachment: scroll; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0px 0px; background-repeat: repeat;"><img alt="" height="337" src="http://thegioibanhkem.com.vn/profiles/thegioibanhkemcomvn/uploads/attach/1449291041_banhsinhnhatcungnhanma.jpg" style="box-sizing: border-box; border: 0px; vertical-align: middle; margin: 0px auto; outline: none 0px; padding: 0px; display: block; background: none 0px 0px repeat scroll transparent;" title="banhsinhnhatcungnhanma.jpg" width="450" /></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px; border: 0px none; font-size: 14px; outline: none 0px; padding: 0px; color: rgb(85, 85, 85); font-family: ''Times New Roman'', Times, serif; line-height: 20px; background-image: none; background-attachment: scroll; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0px 0px; background-repeat: repeat;"> </p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px; border: 0px none; font-size: 14px; outline: none 0px; padding: 0px; color: rgb(85, 85, 85); font-family: ''Times New Roman'', Times, serif; line-height: 20px; background-image: none; background-attachment: scroll; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0px 0px; background-repeat: repeat;">Tất cả những sự chú ý của Nhân Mã với chiếc bánh là những chiếc bánh nhiều vị và trang trí bắt mắt, khẩu vị thay đổi theo từng ngày. Những chiếc bánh ngọt và mềm mại rất cần thiết cho năng lượng của bạn.</p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px; border: 0px none; font-size: 14px; outline: none 0px; padding: 0px; color: rgb(85, 85, 85); font-family: ''Times New Roman'', Times, serif; line-height: 20px; background-image: none; background-attachment: scroll; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0px 0px; background-repeat: repeat;">10. Cung Ma Kết</p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px; border: 0px none; font-size: 14px; outline: none 0px; padding: 0px; color: rgb(85, 85, 85); font-family: ''Times New Roman'', Times, serif; line-height: 20px; background-image: none; background-attachment: scroll; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0px 0px; background-repeat: repeat;"><img alt="" height="309" src="http://thegioibanhkem.com.vn/profiles/thegioibanhkemcomvn/uploads/attach/1449291079_banhsinhnhatcungmaket.jpg" style="box-sizing: border-box; border: 0px; vertical-align: middle; margin: 0px auto; outline: none 0px; padding: 0px; display: block; background: none 0px 0px repeat scroll transparent;" title="banhsinhnhatcungmaket.jpg" width="450" /></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px; border: 0px none; font-size: 14px; outline: none 0px; padding: 0px; color: rgb(85, 85, 85); font-family: ''Times New Roman'', Times, serif; line-height: 20px; background-image: none; background-attachment: scroll; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0px 0px; background-repeat: repeat;"> </p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px; border: 0px none; font-size: 14px; outline: none 0px; padding: 0px; color: rgb(85, 85, 85); font-family: ''Times New Roman'', Times, serif; line-height: 20px; background-image: none; background-attachment: scroll; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0px 0px; background-repeat: repeat;">Cứng đầu và rất kiên trì, tuy vậy Ma Kết lại thích những công thức bánh đơn giản để làm một chiếc bánh ngọt tinh xảo đến không ngờ.</p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px; border: 0px none; font-size: 14px; outline: none 0px; padding: 0px; color: rgb(85, 85, 85); font-family: ''Times New Roman'', Times, serif; line-height: 20px; background-image: none; background-attachment: scroll; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0px 0px; background-repeat: repeat;">11. Cung Bảo Bình</p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px; border: 0px none; font-size: 14px; outline: none 0px; padding: 0px; color: rgb(85, 85, 85); font-family: ''Times New Roman'', Times, serif; line-height: 20px; background-image: none; background-attachment: scroll; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0px 0px; background-repeat: repeat;"> </p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px; border: 0px none; font-size: 14px; outline: none 0px; padding: 0px; color: rgb(85, 85, 85); font-family: ''Times New Roman'', Times, serif; line-height: 20px; background-image: none; background-attachment: scroll; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0px 0px; background-repeat: repeat;"><img alt="" height="468" src="http://thegioibanhkem.com.vn/profiles/thegioibanhkemcomvn/uploads/attach/1449291246_banhsinhnhatbaobinh.jpg" style="box-sizing: border-box; border: 0px; vertical-align: middle; margin: 0px auto; outline: none 0px; padding: 0px; display: block; background: none 0px 0px repeat scroll transparent;" title="banhsinhnhatbaobinh.jpg" width="450" /></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px; border: 0px none; font-size: 14px; outline: none 0px; padding: 0px; color: rgb(85, 85, 85); font-family: ''Times New Roman'', Times, serif; line-height: 20px; background-image: none; background-attachment: scroll; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0px 0px; background-repeat: repeat;"> </p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px; border: 0px none; font-size: 14px; outline: none 0px; padding: 0px; color: rgb(85, 85, 85); font-family: ''Times New Roman'', Times, serif; line-height: 20px; background-image: none; background-attachment: scroll; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0px 0px; background-repeat: repeat;">Bảo Bình luôn tò mò về tất cả những công thức làm bánh và những phát minh công thức, thử thách mình bằng những cuộc thí nghiệm có phần hơi điên rồ trong bếp.</p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px; border: 0px none; font-size: 14px; outline: none 0px; padding: 0px; color: rgb(85, 85, 85); font-family: ''Times New Roman'', Times, serif; line-height: 20px; background-image: none; background-attachment: scroll; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0px 0px; background-repeat: repeat;">12. Cung Song Ngư</p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px; border: 0px none; font-size: 14px; outline: none 0px; padding: 0px; color: rgb(85, 85, 85); font-family: ''Times New Roman'', Times, serif; line-height: 20px; background-image: none; background-attachment: scroll; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0px 0px; background-repeat: repeat;"> </p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px; border: 0px none; font-size: 14px; outline: none 0px; padding: 0px; color: rgb(85, 85, 85); font-family: ''Times New Roman'', Times, serif; line-height: 20px; background-image: none; background-attachment: scroll; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0px 0px; background-repeat: repeat;"><img alt="" border="0" height="315" src="http://thegioibanhkem.com.vn/profiles/thegioibanhkemcomvn/uploads/attach/1449291300_banhsinhnhatcungsongngu.jpg" style="box-sizing: border-box; border: 0px none; vertical-align: middle; margin: 0px auto; outline: none 0px; padding: 0px; display: block; background: none 0px 0px repeat scroll transparent;" title="banhsinhnhatcungsongngu.jpg" width="851" /></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px; border: 0px none; font-size: 14px; outline: none 0px; padding: 0px; color: rgb(85, 85, 85); font-family: ''Times New Roman'', Times, serif; line-height: 20px; background-image: none; background-attachment: scroll; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0px 0px; background-repeat: repeat;"> </p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px; border: 0px none; font-size: 14px; outline: none 0px; padding: 0px; color: rgb(85, 85, 85); font-family: ''Times New Roman'', Times, serif; line-height: 20px; background-image: none; background-attachment: scroll; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0px 0px; background-repeat: repeat;">Song Ngư nhạy cảm và ngọt ngào. Khi chọn bánh cho Song Ngư không nên thêm bớt nguyên liệu và thử những vị mà bạn biết họ sẽ không thích nhé.</p>\r\n', '', '', '', '', '', 1, 1, 1464946362, 1481557419, 0),
