(113, 0, 0, 0, 0, 'tintuc', 1, 0, 'h1-3626.png', 'h1-3626_250x200.png', 'Những chiếc bánh đắt nhất Thế Giới', '', 'nhung-chiec-banh-dat-nhat-the-gioi', '', '', '', '', '', '', 'Những chiếc bánh đắt nhất Thế Giới', 'Những chiếc bánh đắt nhất Thế Giới', 'Những chiếc bánh đắt nhất Thế Giới\r\n', 0, 0, 0, 0, '<p>Thật không thể tin với một số chiếc bánh có giá trị lên tới khủng thậm chí giá trị của nó có thể đủ cho một người sống dư dả tới hết đời người - Chiếc bánh quy đắt nhất Thế Giới</p>\r\n', '<p style="box-sizing: border-box; margin: 0px; border: 0px none; font-size: 14px; outline: none 0px; padding: 0px; color: rgb(85, 85, 85); font-family: ''Times New Roman'', Times, serif; line-height: 20px; background-image: none; background-attachment: scroll; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0px 0px; background-repeat: repeat;">Thật không thể tin với một số chiếc bánh có giá trị lên tới khủng thậm chí giá trị của nó có thể đủ cho một người sống dư dả tới hết đời người</p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px; border: 0px none; font-size: 14px; outline: none 0px; padding: 0px; color: rgb(85, 85, 85); font-family: ''Times New Roman'', Times, serif; line-height: 20px; background-image: none; background-attachment: scroll; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0px 0px; background-repeat: repeat;">-       Chiếc bánh quy đắt nhất Thế Giới</p>\r\n\r\n<p style="box-sizing:border-box; margin:0px; border:0px none; font-size:14px; outline:none 0px; padding:0px; color:rgb(85, 85, 85); font-family:''Times New Roman'', Times, serif; line-height:20px; text-align:center; background-image:none; background-attachment:scroll; background-size:initial; background-origin:initial; background-clip:initial; background-position:0px 0px; background-repeat:repeat"><img alt="banh-quy-tu-tau-titanic" height="250" src="http://thegioibanhkem.com.vn/profiles/thegioibanhkemcomvn/uploads/attach/1446105605_banhquy.jpg" style="box-sizing: border-box; border: 0px; vertical-align: middle; margin: 0px; outline: none 0px; padding: 0px; background: none 0px 0px repeat scroll transparent;" title="banhquy.jpg" width="440" /></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px; border: 0px none; font-size: 14px; outline: none 0px; padding: 0px; color: rgb(85, 85, 85); font-family: ''Times New Roman'', Times, serif; line-height: 20px; text-align: center; background-image: none; background-attachment: scroll; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0px 0px; background-repeat: repeat;"><em style="box-sizing: border-box; border: 0px none; margin: 0px; outline: none 0px; padding: 0px; background: none 0px 0px repeat scroll transparent;">Bánh quy sót lại từ tàu titanic</em></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px; border: 0px none; font-size: 14px; outline: none 0px; padding: 0px; color: rgb(85, 85, 85); font-family: ''Times New Roman'', Times, serif; line-height: 20px; background-image: none; background-attachment: scroll; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0px 0px; background-repeat: repeat;">Vào năm 1912 sau khi thảm kịch chìm tàu Titanic diễn ra cướp đi 1.500 người một chiếc bánh quy vẫn tồn tại bởi một vị cứu hộ đã cất giữ chiếc bánh trong một chiếc phong bì và ngoài có viết dòng chữ (bánh quy Pilot từ tàu cứu hộ Titanic 4/1912) tính tới thời điểm hiện tại đây là chiếc bánh duy nhất còn sót lại trên toàn Thế Giới</p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px; border: 0px none; font-size: 14px; outline: none 0px; padding: 0px; color: rgb(85, 85, 85); font-family: ''Times New Roman'', Times, serif; line-height: 20px; background-image: none; background-attachment: scroll; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0px 0px; background-repeat: repeat;">Vào ngày 24/10 nhà đấu giá henry Aldridge & Son đã tổ chức buổi đấu giá và bất ngờ chiếc bánh đã được một nhà siêu tập Hy Lap mua với giá 22,968 USD</p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px; border: 0px none; font-size: 14px; outline: none 0px; padding: 0px; color: rgb(85, 85, 85); font-family: ''Times New Roman'', Times, serif; line-height: 20px; background-image: none; background-attachment: scroll; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0px 0px; background-repeat: repeat;">Các nhà nghiên cứu đã giải thích cho việc chiếc bánh quy tồn tại hơn 100 năm qua mà không bị mốc hay hỏng như những loại bánh ngọt khác rằng nó giống như chiếc bánh bao gồm nhiều loại gia vị và đã được hóa thạch</p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px; border: 0px none; font-size: 14px; outline: none 0px; padding: 0px; color: rgb(85, 85, 85); font-family: ''Times New Roman'', Times, serif; line-height: 20px; background-image: none; background-attachment: scroll; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0px 0px; background-repeat: repeat;">-       Chiếc <a href="http://thegioibanhkem.com.vn/chi-tiet-bv/banh-sinh-nhat-dep.html" style="box-sizing: border-box; color: rgb(55, 139, 174); text-decoration: none; border: 0px none; margin: 0px; outline: none 0px; padding: 0px; background: none 0px 0px repeat scroll transparent;">bánh sinh nhật</a> đắt nhất Thế Giới</p>\r\n\r\n<p style="box-sizing:border-box; margin:0px; border:0px none; font-size:14px; outline:none 0px; padding:0px; color:rgb(85, 85, 85); font-family:''Times New Roman'', Times, serif; line-height:20px; text-align:center; background-image:none; background-attachment:scroll; background-size:initial; background-origin:initial; background-clip:initial; background-position:0px 0px; background-repeat:repeat"><img alt="chiec-banh-sinh-nhat-dat-nhat-the-gioi" height="595" src="http://thegioibanhkem.com.vn/profiles/thegioibanhkemcomvn/uploads/attach/1446105635_banhsinhnhat.jpg" style="box-sizing: border-box; border: 0px; vertical-align: middle; margin: 0px; outline: none 0px; padding: 0px; background: none 0px 0px repeat scroll transparent;" title="banhsinhnhat.jpg" width="500" /></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px; border: 0px none; font-size: 14px; outline: none 0px; padding: 0px; color: rgb(85, 85, 85); font-family: ''Times New Roman'', Times, serif; line-height: 20px; text-align: center; background-image: none; background-attachment: scroll; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0px 0px; background-repeat: repeat;"><em style="box-sizing: border-box; border: 0px none; margin: 0px; outline: none 0px; padding: 0px; background: none 0px 0px repeat scroll transparent;">Chiếc bánh sinh nhật trị giá nhất Thế Giới</em></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px; border: 0px none; font-size: 14px; outline: none 0px; padding: 0px; color: rgb(85, 85, 85); font-family: ''Times New Roman'', Times, serif; line-height: 20px; background-image: none; background-attachment: scroll; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0px 0px; background-repeat: repeat;">Một gia đình giầu có ở Ả Rập đã mua chiếc bánh trị giá 75 triệu USD để tặng cho con gái nhân dịp sinh nhật, chiếc bánh với chiều dài gần 2m được trang chí bởi những viên kim cương sáng bóng</p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px; border: 0px none; font-size: 14px; outline: none 0px; padding: 0px; color: rgb(85, 85, 85); font-family: ''Times New Roman'', Times, serif; line-height: 20px; background-image: none; background-attachment: scroll; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0px 0px; background-repeat: repeat;">-       Chiếc bánh tầu biển có giá 35 USD</p>\r\n\r\n<p style="box-sizing:border-box; margin:0px; border:0px none; font-size:14px; outline:none 0px; padding:0px; color:rgb(85, 85, 85); font-family:''Times New Roman'', Times, serif; line-height:20px; text-align:center; background-image:none; background-attachment:scroll; background-size:initial; background-origin:initial; background-clip:initial; background-position:0px 0px; background-repeat:repeat"><img alt="chiec-banh-tau-cuop-bien" height="371" src="http://thegioibanhkem.com.vn/profiles/thegioibanhkemcomvn/uploads/attach/1446105663_cuopbien.jpg" style="box-sizing: border-box; border: 0px; vertical-align: middle; margin: 0px; outline: none 0px; padding: 0px; background: none 0px 0px repeat scroll transparent;" title="cuopbien.jpg" width="660" /></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px; border: 0px none; font-size: 14px; outline: none 0px; padding: 0px; color: rgb(85, 85, 85); font-family: ''Times New Roman'', Times, serif; line-height: 20px; text-align: center; background-image: none; background-attachment: scroll; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0px 0px; background-repeat: repeat;"><em style="box-sizing: border-box; border: 0px none; margin: 0px; outline: none 0px; padding: 0px; background: none 0px 0px repeat scroll transparent;">Chiếc bánh độc đáo sáng tạo từ chiếc tầu cưới biển</em></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px; border: 0px none; font-size: 14px; outline: none 0px; padding: 0px; color: rgb(85, 85, 85); font-family: ''Times New Roman'', Times, serif; line-height: 20px; background-image: none; background-attachment: scroll; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0px 0px; background-repeat: repeat;">Vào năm 2012 một kiệt tác của vua đầu bếp Chef Dimuthu đã cho ra một sản phẩm độc đáo chiếc bánh được thiết kế giống như một chiếc tầu của những tên cướp biển mà sản phẩm chiếm được là những viên kim cương chiếc bánh này đã giữ được kỷ lúc trong một thời gian dài</p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px; border: 0px none; font-size: 14px; outline: none 0px; padding: 0px; color: rgb(85, 85, 85); font-family: ''Times New Roman'', Times, serif; line-height: 20px; background-image: none; background-attachment: scroll; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0px 0px; background-repeat: repeat;">-       Chiếc bánh Faberge</p>\r\n\r\n<p style="box-sizing:border-box; margin:0px; border:0px none; font-size:14px; outline:none 0px; padding:0px; color:rgb(85, 85, 85); font-family:''Times New Roman'', Times, serif; line-height:20px; text-align:center; background-image:none; background-attachment:scroll; background-size:initial; background-origin:initial; background-clip:initial; background-position:0px 0px; background-repeat:repeat"><img alt="chiec-banh-hinh-qua-trung" height="719" src="http://thegioibanhkem.com.vn/profiles/thegioibanhkemcomvn/uploads/attach/1446105684_banh.jpg" style="box-sizing: border-box; border: 0px; vertical-align: middle; margin: 0px; outline: none 0px; padding: 0px; background: none 0px 0px repeat scroll transparent;" title="banh.jpg" width="500" /></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px; border: 0px none; font-size: 14px; outline: none 0px; padding: 0px; color: rgb(85, 85, 85); font-family: ''Times New Roman'', Times, serif; line-height: 20px; text-align: center; background-image: none; background-attachment: scroll; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0px 0px; background-repeat: repeat;"><em style="box-sizing: border-box; border: 0px none; margin: 0px; outline: none 0px; padding: 0px; background: none 0px 0px repeat scroll transparent;">Chiếc bánh hình quả trứng độc đáo</em></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px; border: 0px none; font-size: 14px; outline: none 0px; padding: 0px; color: rgb(85, 85, 85); font-family: ''Times New Roman'', Times, serif; line-height: 20px; background-image: none; background-attachment: scroll; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0px 0px; background-repeat: repeat;">Một sáng kiến của Sa hoàng Alexander III tặng cho vợ nhân dịp kỉ niệm ngày cưới, ý tưởng vô cùng sáng tạo được ông lấy từ quả trứng bên trong nhân bánh bao gồm nhiều chất liệu cao cấp <a href="http://thegioibanhkem.com.vn/chi-tiet-bv/banh-kem-sinh-nhat.html" style="box-sizing: border-box; color: rgb(55, 139, 174); text-decoration: none; border: 0px none; margin: 0px; outline: none 0px; padding: 0px; background: none 0px 0px repeat scroll transparent;">bánh kem</a>, bánh joconde…và  còn có một viên kim cương trị giá 2carat</p>\r\n', '', '', '', '', '', 6, 1, 1464947241, 1481557467, 0);
