(114, 0, 0, 0, 0, 'tuongcay', 1, 0, 'h1-7202.png', 'h1-7202_360x315.png', 'Tường cây', '', 'tuong-cay', '', '', '', '', '', '', '', '', '', 0, 0, 0, 0, 'Đây là một công trình được Vườn Nhà Đẹp thực hiện vào thời điểm 23-08-2014. Bạn tham khảo qua hồ sơ thiết kế và thi công bao gồm những gì nhé. Lấy ví dụ trực tiếp từ một công trình sân vườn của căn biệt thự Hồ sơ phối cảnh tổng thể, từng góc nhìn \r\n2.       Hồ sơ triển khai chi tiết cấu tạo hồ cảnh quan, giàn pergola, nhà thủy tạ…  (02 bộ A3 in trắng đen)\r\n3.       Hồ sơ chi tiết định vị bố trí cây lớn, cây bụi, hoa cảnh. (02 bộ A3 in trắng đen)\r\n4.       Bộ hồ sơ định vị đèn chiếu sáng ( chủng loại, kích thước…), hệ thống lọc hồ cá… (02 bộ A3 in trắng đen)\r\n5.       Bảng dự toán chi tiết công trình (02 bộ A3 in trắng đen)\r\n6.       Giám sát tác giả  : Giải đáp các thắc mắc trong quá trình thi công sân vườn.\r\n7.       01 CD tòan bộ File bản vẽ', '<p>Đây là một công trình được Vườn Nhà Đẹp thực hiện vào thời điểm 23-08-2014. Bạn tham khảo qua hồ sơ thiết kế và thi công bao gồm những gì nhé. Lấy ví dụ trực tiếp từ một công trình sân vườn của căn biệt thự Hồ sơ phối cảnh tổng thể, từng góc nhìn <br />\r\n2.       Hồ sơ triển khai chi tiết cấu tạo hồ cảnh quan, giàn pergola, nhà thủy tạ…  (02 bộ A3 in trắng đen)<br />\r\n3.       Hồ sơ chi tiết định vị bố trí cây lớn, cây bụi, hoa cảnh. (02 bộ A3 in trắng đen)<br />\r\n4.       Bộ hồ sơ định vị đèn chiếu sáng ( chủng loại, kích thước…), hệ thống lọc hồ cá… (02 bộ A3 in trắng đen)<br />\r\n5.       Bảng dự toán chi tiết công trình (02 bộ A3 in trắng đen)<br />\r\n6.       Giám sát tác giả  : Giải đáp các thắc mắc trong quá trình thi công sân vườn.<br />\r\n7.       01 CD tòan bộ File bản vẽ</p>\r\n', '', '', '', '', '', 1, 1, 1481542038, 0, 0),
