(16, '', 'gioithieu_slogan', '', '', '', '<p style="text-align: center;">Công trình lớn hay nhỏ đến đâu chúng tôi cũng sẵn sàng đến khảo sát</p>\r\n\r\n<p style="text-align: center;">và tư vấn cho quý khách trước khi tiến hành thi công<span style="font-size:20px;"><span style="line-height:1.7;"><span style="font-family:times new roman,times,serif;">  <span style="color:#FFFFFF;">    </span></span></span></span></p>\r\n', '', '', '', '', '', '', '', '', 0, 0, 1461301276, 1462440550),
