(15, '', 'slogan', '', '', '', '<p style="text-align: center;"><span style="font-size:20px;"><span style="color:#0076a3;"><img alt="" height="29" src="http://localhost/hoangnhu/upload/images/slogan1.png" width="32" />Cơ Khí Máy Xây Dựng Ninh Tuấn Điệp</span> với thế mạnh về kinh nghiệm, sản phẩm và dịch vụ do chúng tôi cung cấp có </span></p>\r\n\r\n<p style="text-align: center;"><span style="font-size:20px;">chất lượng </span><span style="font-size: 20px; line-height: 1.6;">tốt đảm bảo theo yêu cầu kỹ thuật, giá cả hợp lý. Chúng tôi chuyên cung cấp các sản phẩm </span><span style="font-size: 20px; line-height: 1.6;">cơ điện,</span></p>\r\n\r\n<p style="text-align: center;"><span style="font-size: 20px; line-height: 1.6;">máy xây dựng và sữa chữa bảo trì </span><span style="font-size: 20px; line-height: 1.6;">các thiết bị liên hệ. </span><span style="line-height: 1.6;">  </span><span style="font-size: 20px; line-height: 1.6;"><img alt="" height="29" src="http://localhost/hoangnhu/upload/images/slogan2.png" width="32" /></span><span style="line-height: 1.6;"> </span></p>\r\n', '', '', '', '', '', '', '', '', 0, 0, 1460017547, 1460018778),
